  false,\n\t\"url\": null,\n\t\"notes\": \"There are 60 supplementary EJ Indexes in
  EJSCREEN that are divided into 5 categories: EJ Index with supplementary demographic
  index, Supplementary EJ Index 1 with demographic index, Supplementary EJ Index 1
  with supplementary demographic index, Supplementary EJ Index 2 with demographic
  index, and Supplementary EJ Index 2 with supplementary demographic index. Each category
  covers the same 12 environmental indicators of Particulate Matter (PM2.5), Ozone,
  NATA Diesel PM, NATA Cancer Risk, NATA Neuro HI, NATA Respiratory HI, Traffic Proximity
  and Volume, Lead Paint Indicator, Proximity to Risk Management Plan Sites, Proximity
  to National Priorities List Sites, Proximity to Treatment Storage and Disposal Facilities,
  and Proximity to Major Direct Water Dischargers.\",\n\t\"owner_org\": \"6d90e48d-3076-4327-b2f4-c33919f374d5\",\n\t\"extras\":
